import { BiLogOutCircle } from "react-icons/bi";



class Admin extends Component {
    render() {
    
    return (
        <div class="admin">

        <h2>Welcome Admin!!</h2>

        <header class="header" >

        <nav>
            <img src="logob.png" class="logob" />
            <ul>
              {/* <li><a href="">HOME</a></li>
